import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import ButtonBase from "@material-ui/core/Button";
import potn_logo from "./potn_logo.jpg";
import "./index.css";

const styles = makeStyles((theme) => ({
  name: {
    marginBottom: "5%",
    textShadow: "5px 5px black",
    color: "white",
  },
  sign_up: {
    marginLeft: "100px",
    marginRight: "100px",
    padding: "10px 50px",
    borderRadius: "100px 100px 100px 100px",
  },
  login: {
    marginLeft: "100px",
    marginRight: "100px",
    padding: "10px 57px",
    borderRadius: "100px 100px 100px 100px",
  },
}));

export default function POTNLogo() {
  const classes = styles();

  return (
    <div className="container">
      <img
        src={potn_logo}
        style={{ width: "100%", height: "100%", verticalAlign: "top" }}
      ></img>
      <div className="centered">
        <div className={classes.name} style={{ webkitTextStroke: "1px grey" }}>
          Princeton Online Tutoring Network
        </div>
        <ButtonBase className={classes.sign_up} variant="outlined">
          SIGN UP
        </ButtonBase>
        <ButtonBase className={classes.login} variant="outlined">
          LOGIN
        </ButtonBase>
      </div>
    </div>
  );
}
